import React from 'react';
import Tweet from "./Tweet";



function App() {

  return(
    <div className="app">
      <h1>Hello React</h1>
      <Tweet name="User1" message="The sky is blue"/>
      <Tweet name="User2" message="My name is User2"/>
      <Tweet name="User3" message="Billy Bob"/>
      <Tweet name="User4" message="Hello World"/>
    </div>
  );
};


export default App;
